import React from 'react';

function AboutSection() {
  return (
    <section id="about" className="container mt-5">
      <div className="row align-items-center">
        <div className="col-md-6">
          <h2>About Me</h2>
          <p>
            Hi, I'm [Your Name], a passionate computer science student specializing in [Your Specialization].
            I have a keen interest in [areas of interest]. My journey in [relevant field or topic] started
            when [a brief story about how you started in this field].
          </p>
          <p>
            I'm currently working on [mention any current projects or research]. In my free time, I enjoy [your hobbies or interests].
          </p>
        </div>
      </div>
    </section>
  );
}

export default AboutSection;
